import React, { useEffect, useState } from 'react';
import { useAuth } from '../AuthProvider';
import Navbar from '../components/NavBar';
import "../styles/ListProducts.css";

const FacturaList = () => {
  const [facturas, setFacturas] = useState([]);
  const [mensaje, setMensaje] = useState('');
  const [filtroNombre, setFiltroNombre] = useState('');
  const auth = useAuth();

  const formatNumber = (number) => {
    return number.toLocaleString('es-ES'); // Cambia 'es-ES' por tu localizaciÃ³n deseada
  };

  useEffect(() => {
    const fetchFacturas = async () => {
      try {
        const response = await fetch('http://localhost:3000/factura', {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
            Authorization: auth.token,
          },
        });

        if (response.ok) {
          const data = await response.json();
          setFacturas(data.data);
        } else {
          throw new Error('Error al cargar las facturas');
        }
      } catch (error) {
        console.error('Error al obtener las facturas:', error.message);
        setMensaje('Error al cargar las facturas');
      }
    };

    fetchFacturas();
  }, [auth.token]);

  const handleFiltroNombreChange = (e) => {
    setFiltroNombre(e.target.value);
  };

  const filteredFacturas = facturas.filter((factura) =>
    factura.NOMBRE.toLowerCase().includes(filtroNombre.toLowerCase())
  );

  return (
    <div>
      <Navbar />
      <div className="backgroundPL">
        <div className="containerPL">
          <h2>Lista de Facturas</h2>
          {mensaje && <div id="mensaje">{mensaje}</div>}
          <div className="filtro-container">
            <label htmlFor="filtroNombre">Filtrar por Nombre del Cliente:</label>
            <input
              type="text"
              id="filtroNombre"
              name="filtroNombre"
              value={filtroNombre}
              onChange={handleFiltroNombreChange}
            />
          </div>
          <table className="tablePL">
            <thead>
              <tr>
                <th>ID Factura</th>
                <th>Fecha</th>
                <th>CÃ©dula Cliente</th>
                <th>Nombre Cliente</th>
                <th>Apellidos Cliente</th>
                <th>Usuario</th>
                <th>Subtotal</th>
                <th>Total a Pagar</th>
              </tr>
            </thead>
            <tbody>
              {filteredFacturas.map((factura) => (
                <tr key={factura.ID_FACTURA}>
                  <td>{factura.ID_FACTURA}</td>
                  <td>{factura.FECHA}</td>
                  <td>{factura.CEDULA}</td>
                  <td>{factura.NOMBRE.toUpperCase()}</td>
                  <td>{factura.APELLIDOS.toUpperCase()}</td>
                  <td>{factura.NOMBRE_USUARIO.toUpperCase()}</td>
                  <td>$ {formatNumber(factura.SUBTOTAL)}</td>
                  <td>$ {formatNumber(factura.TOTAL_PAGAR)}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default FacturaList;
